import { StyleSheet, View, TouchableOpacity, Image } from 'react-native'
import React from 'react'
import goBack from '../assets/back.png'
import avatar from '../assets/Avatar.png'

const Header = () => {
  return (
    <View style={styles.header}>

        <TouchableOpacity
       // onPress={}
       style={styles.backIcon}
        >
            <Image 
            style={styles.iconback}
            source={goBack}
            />
        </TouchableOpacity>
        

        <TouchableOpacity
       // onPress={}
       style={styles.avatarIcon}
        >
            <Image 
            style={styles.iconavatar}
            source={avatar}
            />
        </TouchableOpacity>
    </View>
  )
}

export default Header

const styles = StyleSheet.create({


    header:{
        flex: 1,
        justifyContent: 'space-between',
        width:'100%',
        height:75,
        flexDirection:'row',
        alignItems:'center',

    },
    backIcon:{

        width:25,
        height:25,
        borderRadius: 10,
        backgroundColor: '#EEF0F1',
    },
    avatarIcon:{
        width:25,
        height:25,
        borderRadius: 10,
        backgroundColor: '#EEF0F1',
        marginRight:35

    },
    iconback:{
        flex: 1,
        width:10, 
        height: 10,
        resizeMode: 'contain',
        
        
    },
    iconavatar:{

        
        flex: 1,
        width:20, 
        height: 20,
        resizeMode: 'contain'

       

    }

})
